import React from 'react';
import CustomNavbar from '../components/CustomNavbar';
import Breadcrumb from '../components/Breadcrumb';
import HRService from '../components/Service/HRService';
import PrototypeService from '../components/Service/Sservice/PrototypeService';
import Partner from '../components/Partner';
import ServiceSubscribe from '../components/ServiceSubscribe';
import FooterTwo from '../components/Footer/FooterTwo';
import ServiceData from '../components/Service/ServiceData';
import FooterData from '../components/Footer/FooterData';
import Featuresitems from '../components/Features/Featuresitems';

const Service = () => {
    return(
        <div className="body_wrapper">
            <CustomNavbar mClass="menu_tracking" nClass="mr-auto" hbtnClass="tracking_btn"/>{/* ESTA ES LA PARTE DEL MENU DEL HOME */}
            {/*<CustomNavbar slogo="sticky_logo" mClass="menu_four" nClass="w_menu ml-auto mr-auto"/> */}
            <Breadcrumb breadcrumbClass="breadcrumb_area" imgName="breadcrumb/banner_bg.png" Ptitle="Transparencia" Pdescription=""/>{/**esta es la parte del banner */}

            <section className="process_area bg_color sec_pad">
                <div className="container">
                    <div className="features_info text-justify">
                        <Featuresitems rowClass="row" aClass="pl_80" fimage="process_2.png" iImg="icon02.png" ftitle="Ley de transparencia y Acceso a la información Pública" descriptions="La información materia de este ordenamiento es un bien del dominio público, cuya titularidad reside en la sociedad, misma que tendrá en todo momento la facultad de disponer de ella para los fines que considere sin necesidad de que alguna persona la solicite. Este atendimiento a lo señalado en los artículos 8 y 15 de la Ley de Transparencia y Acceso a la Información Pública del Estado de Jalisco y sus Municipios."/>
                    </div>
                </div>
            </section>
            <HRService ServiceData={ServiceData}/>{/**esta es la parte de los iconos */}
            {/*<PrototypeService/>esta es la parte de los servicios de la página */}
            <Partner pClass="partner_logo_area_two" pClasst="pt-0 mb-0"/>{/**esta es la parte de los logos de la dependencia */}
            {/*<ServiceSubscribe sClass="s_form_info_two"/>esta es la parte del newssletter */}
            <FooterTwo fClass="pt_150" FooterData={FooterData}/>{/**esta es la parte footer */}
        </div>
    )
}
export default Service;
